import React from 'react';
import {Link} from "react-router-dom";

const About = () => {
    return (
        <div className="navbar">
            <div className="navbar-elems">
                <Link to="/about" >About</Link>
                <Link to="/posts" >Pages</Link>
            </div>
        </div>
    );
};

export default About;
